import React, { useState } from 'react';
import { auth, database } from '../firebase';
import { set, ref } from 'firebase/database';
import { onAuthStateChanged } from 'firebase/auth';
import { motion } from 'framer-motion'; // Import Framer Motion
import Form from './form';
import Register from './register';
import FaceIntegrate from './face_int';
import { useNavigate } from 'react-router-dom';
import {getDownloadURL} from 'firebase/storage'
import {storage} from '../firebase'
 
const Login = () => {
  const [login, setLogin] = useState(true);
  const [user, setUser] = useState(false);
  const [image,setImage]= useState(false)
const nav = useNavigate()
  const data = (data, uid) => {
    set(ref(database, '/users/' + uid), data);
  };
  const fetchimg = ( )=>{

    onAuthStateChanged(auth, (user) => {
         

      if (user) {
       const ref3 = ref(storage,`${user.uid}/Integrationimage.jpg`) 
       getDownloadURL(ref3).then((snap)=>{
        setImage(true)
       }).catch((error)=>{
        setImage(false)
       })
       if(image){
        nav("/Validation");
       }
       else{
        
       }
       

      
        
      } else {
         
      }
    })
  }
  React.useEffect(() => {
    onAuthStateChanged(auth, user => {
      if (user) {
        setUser(true);
      } else {
        setUser(false);
      }
      
    });
    fetchimg()
  }, []);



  return (
    
    <div>
      <div
        className="absolute inset-0 z-1 bg-cover bg-center"
        style={{ backgroundImage: 'url("https://t4.ftcdn.net/jpg/06/17/47/47/360_F_617474728_dEQbw855a41IUsKDpKdwkZTjgQ5I4geM.jpg")' }}
      />
    
    <div className= "absolute inset-0 bg-black opacity-50 z-10" />
{/* Header Section */}
<header className="z-20 fixed top-0 left-0 right-0 px-6 py-4 flex items-center justify-between">
  <h1 className="text-3xl font-bold text-white">AI Nexus</h1>
  <div className="flex items-center space-x-4">
    <motion.div
      initial={{ opacity: 0, x: 20 }}
      animate={{ opacity: 1, x: 0 }}
      transition={{ delay: 0.8, duration: 0.8 }}
      className="bg-gray-800 bg-opacity-50 rounded-lg p-2 flex items-center"
    >
      <svg
        xmlns="http://www.w3.org/2000/svg"
        className="h-6 w-6 mr-2 text-white"
        fill="none"
        viewBox="0 0 24 24"
        stroke="currentColor"
      >
        <path
          strokeLinecap="round"
          strokeLinejoin="round"
          strokeWidth={2}
          d="M12 6v6m0 0v6m0-6h6m-6 0H6"
        />
      </svg>
      <input
        type="text"
        placeholder="Search"
        className="bg-transparent border-none focus:outline-none text-white"
      />
    </motion.div>
    <nav className="flex space-x-4">
      <a href="#" className="hover:text-gray-300 transition-colors duration-300 text-white"  onClick={()=> nav("/Login")}>
        Home
      </a>
      <a href="#" className="hover:text-gray-300 transition-colors duration-300 text-white"  onClick={()=> nav("/Login")}>
        Features
      </a>
      <a href="#" className="hover:text-gray-300 transition-colors duration-300 text-white"  onClick={()=> nav("/Login")}>
        Solutions
      </a>
      <a href="#" className="hover:text-gray-300 transition-colors duration-300 text-white"  onClick={()=> nav("/Login")}>
        About Us
      </a>
      <a href="#" className="hover:text-gray-300 transition-colors duration-300 text-white"  onClick={()=> nav("/Login")}>
        Contact
      </a>
      <button className="bg-blue-500 hover:bg-blue-600 text-white font-bold py-2 px-4 rounded transition-all duration-300" onClick={()=> nav("/Login")}>
        Login
      </button>
    </nav>
  </div>
</header>
<section className="flex flex-col items-center justify-center h-screen relative z-10">
      <div className="min-h-screen flex items-center py-12 px-4 sm:px-6 lg:px-8">
        <div className="max-w-7xl mx-auto flex items-center justify-between">
          {/* Large image on the left side */}
          <motion.div
            className="w-1/2"
            initial={{ opacity: 0, scale: 0.8 }}
            animate={{ opacity: 1, scale: 1 }}
            transition={{ duration: 0.5 }}
          >
            <img
              src="data:image/png;base64,"
              alt=""
              className="rounded-xl transform scale-100 transition-transform duration-500 ease-in-out hover:scale-105 round"
              width={2500}
              height={2500}
            />
          </motion.div>
          <div className="text-center pl-4 md:pl-0 ab transform scale-100 transition-transform duration-500 ease-in-out hover:scale-105">
            <div className="text-3xl font-bold text-white mb-4 ab">
              AI Nexus
            </div>
            <div className="text-2xl text-gray-400 ab">
              Your Gateway to Artificial Intelligence
            </div>
          </div>

          {/* Form on the right side */}
          <div className="w-1/2 pl-8">
            {/*form */}
            { (
              user ==true ? <FaceIntegrate/>:
            (login === true ? (
              <motion.div
                initial={{ opacity: 0, x: -50 }}
                animate={{ opacity: 1, x: 0 }}
                transition={{ duration: 0.5 }}
              >
                <Form />
              </motion.div>
            ) : (
              <Register sendData={data} />
            ))
            )}
            <div className="text-sm text-center mt-4">
              <p className="text-gray-400">
                {login === true ? 'New user?' : ''}
                <a
                  href="#"
                  onClick={() => setLogin(false)}
                  className="font-medium text-indigo-400 hover:text-indigo-300 transform scale-100 transition-transform duration-500 ease-in-out hover:scale-105"
                >
                  {login === true ? 'Create an account' : 'Login Now'}
                </a>
              </p>
            </div>
          </div>
        </div>
      </div>
    
      </section> 
    </div>
    
  );
};

export default Login;
